r&b singer and producer r. kelly has been accused of abuse, predatory behavior and pedophilia targeting black girls throughout his career, but he's avoided criminal conviction despite damning evidence and multiple witnesses. this is oronike odeleye, co-founder of #muterkelly‚Äîa campaign to end his music career. "it's not enough to be outraged," she told us monday, calling on the public to shut down r. kelly's performances and music in circulation. "we, as a community, need to step up. we failed [these girls] in the past, but we need to step up now and do what we can to help them." a chilling new documentary called #survivingrkelly chronicles two decades of allegations against him and talks with the desperate families of his alleged victims‚Äîsome of whom haven't seen their daughters in years, since kelly targeted them as teens. we covered this on monday's show‚Äîfind it wherever you get your podcasts, or at democracynow.org

#rkelly #sexualassault #domesticviolence #metoo

